import React from "react";
import Navbar from "../navbar/Navbar"
import Pricing from "../pricing/Pricing"
import Footer from '../footer/Footer';
import Copyright from '../copyright/Copyright';


const PricngPage = () => {
    return (
        <>
            <Navbar/>
            <Pricing/>
            <Footer/>
            <Copyright/>
        </>
    )
}

export default PricngPage;
